

public class MinMax {
	double min;
	double max;
	
	public MinMax(double min, double max) {
		super();
		this.min = min;
		this.max = max;
	}

	public MinMax() {
		// TODO Auto-generated constructor stub
	}

	public double getMin() {
		return min;
	}

	public void setMin(double min) {
		this.min = min;
	}

	public double getMax() {
		return max;
	}

	public void setMax(double max) {
		this.max = max;
	}

	
	
	

}
